import { AllTypeActions } from '../types';
import { AnyAction, Reducer } from 'redux';

export interface IApplicationModal {}

export const GetModalUserReducser: Reducer = (state: { component: any } = { component: null }, action: AnyAction) => {
	switch (action.type) {
		case AllTypeActions.CHANGE_MODAL_CONTENT: {
			return {
				...state,
				component: action.component,
			};
		}
		case AllTypeActions.LOAD_USERS_SUCCESS: {
			console.log(action.data);
			return {
				...state,
				data: action.data,
				loading: false,
			};
		}
		case AllTypeActions.LOAD_USERS_ERROR: {
			return {
				...state,
				loading: false,
				error: action.error,
			};
		}
		default: {
			return state;
		}
	}
};
